import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './components/HomePage';
import DistrictCourtPage from './components/DistrictCourt';
import HighCourtPage from './components/HighCourt';
import SupremeCourtPage from './components/SupremeCourt';
import StateSelection from './components/StateSelection'; // This will be reused for both High and District Court

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/district" element={<DistrictCourtPage />} />
        <Route path="/high" element={<StateSelection courtType="High Court" />} />
        <Route path="/district/:state" element={<DistrictCourtPage />} /> {/* Dynamic route for district court states */}
        <Route path="/high/:state" element={<HighCourtPage />} /> {/* Dynamic route for high court states */}
        <Route path="/supreme" element={<SupremeCourtPage />} />
      </Routes>
    </Router>
  );
}

export default App;
